		function trim_to_sentence(input)
		{
			let p1 = input.lastIndexOf(".");
			let p2 = input.lastIndexOf("!");
			let p3 = input.lastIndexOf("?");
			let last = Math.max(p1,p2,p3);
			if(last>0)
			{
				return input.substring(0,last+1);
			}
			return input;
		}

